MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The Questa SIM Tutorial provides lessons for gaining a basic understanding of how to simulate your design. It includes step-by-step instruction on the basics of simulation - from creating a working library, compiling your design, and loading the simulator to running the simulation and debugging your results. ");
MGCAddSnippet(5, "Questa SIM documentation is available in both PDF and HTML formats. Refer to the table below for a complete list.");
MGCAddSnippet(6, "Questa SIM PDF documentation requires an Adobe Acrobat Reader for viewing. ");
MGCAddSnippet(7, "A support contract with Mentor, a Siemens Business, is a valuable investment in your organization s success. With a support contract, you have 24/7 access to the comprehensive and personalized Support Center portal.");
MGCAddSnippet(8, "Preparation for some of the lessons leaves certain details up to you. You will decide the best way to create directories, copy files, and execute programs within your operating system. (When you are operating the simulator within the Questa SIM GUI, the interface is consistent for all platforms.)");
MGCAddSnippet(9, "Questa SIM comes with Verilog and VHDL versions of the designs used in most of these lessons. This allows you to do the tutorial regardless of which license type you have. Though we have tried to minimize the differences between the Verilog and VHDL versions, we could not do so in all cases. In cases where the designs differ (for example, line numbers or syntax), you will find language-specific instructions. Follow the instructions that are appropriate for the language you use.");
MGCAddSnippet(10, "Questa SIM is a verification and simulation tool for VHDL, Verilog, SystemVerilog, SystemC, and mixed-language designs. ");
MGCAddSnippet(11, "Before discussing the basic simulation flow, it is important to understand design optimization. By default, Questa SIM optimizations are automatically performed on all designs. These optimizations are designed to maximize simulator performance, yielding improvements up to 10X, in some Verilog designs, over non-optimized runs.");
MGCAddSnippet(12, "The following diagram shows the basic steps for simulating a design in Questa SIM.");
MGCAddSnippet(13, "A project is a collection mechanism for an HDL design under specification or test. Even though you do not have to use projects in Questa SIM, they may ease interaction with the tool and are useful for organizing files and specifying simulation settings.");
MGCAddSnippet(14, "Questa SIM uses libraries in two ways: 1) as a local working library that contains the compiled version of your design; 2) as a resource library. The contents of your working library will change as you update your design and recompile. A resource library is typically static and serves as a parts source for your design. You can create your own resource libraries, or they may be supplied by another design team or a third party (for example, a silicon vendor).");
MGCAddSnippet(15, "Questa SIM offers numerous tools for debugging and analyzing your design. ");
MGCAddSnippet(16, "In this lesson you will guide you through the basic simulation flow.");
MGCAddSnippet(17, "The sample design for this lesson is a simple 8-bit, binary up-counter with an associated test bench. ");
MGCAddSnippet(18, "Before you can simulate a design, you must first create a library and compile the source code into that library.");
MGCAddSnippet(19, "With the working library created, you are ready to compile your source files.");
MGCAddSnippet(20, "Optimizing your design for simulation will speed the process.");
MGCAddSnippet(21, "Now you are ready to load the design into the simulator.");
MGCAddSnippet(22, "We are ready to run the simulation. But before we do, we will open the Wave window and add signals to it. ");
MGCAddSnippet(23, "Next you will take a brief look at one interactive debugging feature of the Questa SIM environment. You will set a breakpoint in the Source window, run the simulation, and then step through the design under test. Breakpoints can be set only on executable lines, which are indicated with red line numbers.");
MGCAddSnippet(24, "This concludes this lesson. Before continuing we need to end the current simulation.");
MGCAddSnippet(25, "In this lesson you will create a project. ");
MGCAddSnippet(26, "The sample design for this lesson is a simple 8-bit, binary up-counter with an associated test bench. ");
MGCAddSnippet(27, "Common tasks for creating and building a new project.");
MGCAddSnippet(28, "We will start the process of creating a new project by defining the project settings.");
MGCAddSnippet(29, "Once you click OK to accept the new project settings, a blank Project window and the  Add items to the Project  dialog box will appear. ");
MGCAddSnippet(30, "By default Questa SIM performs default binding of VHDL designs when you load the design with the vsim command. However, you can elect to perform default binding at compile time. If you elect to do default binding at compile, then the compile order is important. Follow these steps to change compilation order within a project.");
MGCAddSnippet(31, "With the Project settings defined and objects added to the project, you are ready to compile the design.");
MGCAddSnippet(32, "Design optimization helps to decrease simulation time.");
MGCAddSnippet(33, "Now we are ready to load the design into the simulator.");
MGCAddSnippet(34, "If you have a lot of files to add to a project, you may want to organize them in folders. You can create folders either before or after adding your files. ");
MGCAddSnippet(35, "As shown previously, the Add items to the Project dialog box has an option for adding folders. If you have already closed that dialog box, you can use a menu command to add a folder.");
MGCAddSnippet(36, "If you do not place files into a folder when you first add the files to the project, you can move them into a folder using the Project Compiler Settings dialog box.");
MGCAddSnippet(37, "A Simulation Configuration associates a design unit(s) and its simulation options. For example, let us say that every time you load tcounter.v you want to set the simulator resolution to picoseconds (ps) and enable event order hazard checking. Ordinarily, you would have to specify those options each time you load the design. With a Simulation Configuration, you specify options for a design and then save a  configuration  that associates the design and its options. The configuration is then listed in the Project window and you can double-click it to load tcounter.v along with its options.");
MGCAddSnippet(38, "This concludes this lesson. Before continuing you need to end the current simulation and close the current project.");
MGCAddSnippet(39, "In this lesson you will practice working with multiple libraries. You might have multiple libraries to organize your design, to access IP from a third-party source, or to share common parts between simulations. ");
MGCAddSnippet(40, "The sample design for this lesson is a simple 8-bit, binary up-counter with an associated test bench. ");
MGCAddSnippet(41, "Before creating the resource library, make sure the modelsim.ini in your install directory is  Read Only.  This will prevent permanent mapping of resource libraries to the master modelsim.ini file. ");
MGCAddSnippet(42, "Now you will create a project that contains tcounter.v, the counter s test bench.");
MGCAddSnippet(43, "To wrap up this part of the lesson, you will link to the parts_lib library you created earlier. But first, try loading the test bench without the link and see what happens. ");
MGCAddSnippet(44, "The following procedure is for those working with Verilog designs.");
MGCAddSnippet(45, "Optimizing the design speeds simulation throughput.");
MGCAddSnippet(46, "The following procedure is for those working with VHDL designs.");
MGCAddSnippet(47, "Optimizing the design speeds simulation throughput.");
MGCAddSnippet(48, "Linking to a resource library requires that you specify a  search library  when you invoke the simulator.");
MGCAddSnippet(49, "If you reference particular VHDL resource libraries in every VHDL project or simulation, you may want to permanently map the libraries. Doing this requires that you edit the master modelsim.ini file in the installation directory. Though you will not actually practice it in this tutorial, here are the steps for editing the file:");
MGCAddSnippet(50, "This concludes this lesson. Before continuing we need to end the current simulation and close the project.");
MGCAddSnippet(51, "Questa SIM treats SystemC as just another design language. With only a few exceptions in the current release, you can simulate and debug your SystemC designs the same way you do HDL designs.");
MGCAddSnippet(52, "There are two sample designs for this lesson. The first is a very basic design, called  basic , containing only SystemC code. The second design is a ring buffer where the test bench and top-level chip are implemented in SystemC and the lower-level modules are written in HDL.");
MGCAddSnippet(53, "SystemC is a licensed feature. You need the systemc license feature in your Questa SIM license file to simulate SystemC designs. Please contact your Mentor Graphics sales representatives if you currently do not have such a feature.");
MGCAddSnippet(54, "There are a few steps you must take to prepare a SystemC design to run on Questa SIM.");
MGCAddSnippet(55, "With the edits complete, you are ready to compile the design. Designs that contain only SystemC code are compiled with the sccom command.");
MGCAddSnippet(56, "In this next example, you have a SystemC test bench that instantiates an HDL module. In order for the SystemC test bench to interface properly with the HDL module, you must create a stub module, a foreign module declaration. ");
MGCAddSnippet(57, "SystemC objects are denoted in the Questa SIM GUI with a green  S  in the Library window and a green square, circle, or diamond icon elsewhere.");
MGCAddSnippet(58, "As with HDL files, you can set breakpoints and step through SystemC files in the Source window. In the case of SystemC, Questa SIM uses C Debug, an interface to the open-source gdb debugger. ");
MGCAddSnippet(59, "To examine the value of a SystemC object or variable, you can use the examine command or view the value in the Objects window.");
MGCAddSnippet(60, "You can easily remove a breakpoint and rerun the simulation.");
MGCAddSnippet(61, "This concludes the lesson. Before continuing we need to quit the C debugger and end the current simulation.");
MGCAddSnippet(62, "The Wave window allows you to view the results of your simulation as HDL waveforms and their values. ");
MGCAddSnippet(63, "For the examples in this exercise, we will use the design simulated in the Basic Simulation lesson.");
MGCAddSnippet(64, "Questa SIM offers several methods for adding objects to the Wave window. In this exercise, you will try different methods.");
MGCAddSnippet(65, "There are numerous methods for zooming the Waveform display.");
MGCAddSnippet(66, "Cursors mark simulation time in the Wave window. When Questa SIM first draws the Wave window, it places one cursor at time zero. Clicking in the cursor timeline brings the cursor to the mouse location.");
MGCAddSnippet(67, "Let s look at the information provided when using a single cursor.");
MGCAddSnippet(68, "Even more information is available when working with multiple cursors.");
MGCAddSnippet(69, "If you close the Wave window, the tool discards any configurations you made to the window (for example, signals added, cursors set). However, you can use the Save Format command to capture the current Wave window display and signal preferences to a .do file. You open the .do file later to recreate the Wave window as it appeared when the file was created. ");
MGCAddSnippet(70, "This concludes this lesson. Before continuing you need to end the current simulation.");
MGCAddSnippet(71, "The Waveform Editor creates stimulus for your design via interactive manipulation of waveforms. You can then run the simulation with these edited waveforms or export them to a stimulus file for later use.");
MGCAddSnippet(72, "The sample design for this lesson is a simple 8-bit, binary up-counter that was used in the Basic Simulation lesson.");
MGCAddSnippet(73, "Before using the Waveform Editor we will compile and load a design.");
MGCAddSnippet(74, "Waveform Editor includes a Create Pattern Wizard that walks you through the process of creating editable waveforms.");
MGCAddSnippet(75, "Waveform Editor gives you numerous commands for interactively editing waveforms (for example, invert, mirror, stretch edge, cut, paste, and so on). You can access these commands through the menus, toolbar buttons, or through keyboard and mouse shortcuts. You will try out several commands in this part of the exercise.");
MGCAddSnippet(76, "You can save the commands that Questa SIM used to create the waveforms. You can load this  format  file at a later time to re-create the waves. In this exercise, we will save the commands, quit and reload the simulation, and then open the format file.");
MGCAddSnippet(77, "At this point you can run the simulation or you can export the created waveforms to one of four stimulus file formats. You will run the simulation in a minute but first export the created waveforms so you can use them later in the lesson.");
MGCAddSnippet(78, "Once you have finished editing the waveforms, you can run the simulation. ");
MGCAddSnippet(79, "Earlier in the lesson you exported the created waveforms to a test bench file. In this exercise you will compile and load the test bench and then run the simulation.");
MGCAddSnippet(80, "Earlier in the lesson you exported the created waveforms to an extended VCD file. In this exercise you will use that file to stimulate the counter design unit.");
MGCAddSnippet(81, "This concludes this lesson. Before continuing we need to end the current simulation.");
MGCAddSnippet(82, "The Schematic window allows you to explore the physical connectivity of your design; to trace events that propagate through the design; and to identify the cause of unexpected outputs. The window displays processes, signals, nets, registers, VHDL architectures, and Verilog modules.");
MGCAddSnippet(83, "The sample design for this lesson is a test bench that verifies a cache module and how it works with primary memory. A processor design unit provides read and write requests.");
MGCAddSnippet(84, "In this exercise you will use a DO file to compile and load the design. ");
MGCAddSnippet(85, "A primary use of the incremental view of the Schematic window is exploring the physical connectivity of your design. You do this by expanding the view from process to process, to display the drivers/receivers of a particular signal, net, register, process, module or architecture.");
MGCAddSnippet(86, "The Schematic window allows you to display a source code preview of any design object.");
MGCAddSnippet(87, "Contents of complex instances are folded (hidden) in the Incremental view to maximize screen space and improve the readability of the schematic.");
MGCAddSnippet(88, "The Schematic window gives you the ability to trace events to their cause. ");
MGCAddSnippet(89, "We will use the current time set by the cursor in the embedded Wave viewer. The Current Time Label is on by default, the following instructions allow you to turn it off or on in the Incremental View.");
MGCAddSnippet(90, "Now we will trace an event.");
MGCAddSnippet(91, "This concludes this lesson. Before continuing we need to end the current simulation.");
MGCAddSnippet(92, "The Dataflow window allows you to explore the  physical  connectivity of your design; to trace events that propagate through the design; and to identify the cause of unexpected outputs. The window displays processes; signals, nets, and registers; and interconnect.");
MGCAddSnippet(93, "The sample design for this lesson is a test bench that verifies a cache module and how it works with primary memory. A processor design unit provides read and write requests.");
MGCAddSnippet(94, "In this exercise you will use a DO file to compile and load the design. ");
MGCAddSnippet(95, "A primary use of the Dataflow window is exploring the  physical  connectivity of your design. You do this by expanding the view from process to process. This allows you to see the drivers/receivers of a particular signal, net, or register.");
MGCAddSnippet(96, "Another useful debugging feature is tracing events that contribute to an unexpected output value. Using the Dataflow window s embedded Wave Viewer, you can trace backward from a transition to a process or signal that caused the unexpected output.");
MGCAddSnippet(97, "The Dataflow window lets you easily track an unknown value (X) as it propagates through the design. The Dataflow window is dynamically linked to the Wave window, so you can view signals in the Wave window and then use the Dataflow window to track the source of a problem. As you traverse your design in the Dataflow window, appropriate signals are added automatically to the Wave window.");
MGCAddSnippet(98, "You can display connectivity in the Dataflow window using hierarchical instances. You enable this by modifying the options prior to adding objects to the window.");
MGCAddSnippet(99, "This concludes this lesson. Before continuing we need to end the current simulation.");
MGCAddSnippet(100, "In this lesson you will learn how to view and initialize memories. ");
MGCAddSnippet(101, "The installation comes with Verilog and VHDL versions of the example design.");
MGCAddSnippet(102, "Before viewing and initializing memories we need to compile and load a design.");
MGCAddSnippet(103, "The Memory List window lists all memory instances in the design, showing for each instance the range, depth, and width. Double-clicking an instance opens a window displaying the memory data.");
MGCAddSnippet(104, "You can navigate to specific memory address locations, or to locations containing particular data patterns. First, you will go to a specific address.");
MGCAddSnippet(105, "You can save memory data to a file that can be loaded at some later point in simulation. ");
MGCAddSnippet(106, "In Questa SIM, it is possible to initialize a memory using one of three methods: from an exported memory file, from a fill pattern, or from both.");
MGCAddSnippet(107, "The Memory Data windows can also be used interactively for a variety of debugging purposes. The features described in this section are useful for this purpose. ");
MGCAddSnippet(108, "This concludes this lesson. Before continuing you need to end the current simulation.");
MGCAddSnippet(109, "The Profiler identifies the percentage of simulation time spent in each section of your code as well as the amount of memory allocated to each function and instance. ");
MGCAddSnippet(110, "The example design for this lesson consists of a finite state machine which controls a behavioral memory. The test bench test_sm provides stimulus. ");
MGCAddSnippet(111, "Before we can use the Profiler we must compile a design and load it into the simulator.");
MGCAddSnippet(112, "You will now run the simulation and view the profiling data.");
MGCAddSnippet(113, "Statistical performance data is displayed in four profile windows: Ranked, Call Tree, Structural, and Design Unit. Additional profile details about those statistics are displayed in the Profile Details window. All of these windows are accessible through the View Profiling menu selection in the Main GUI window. ");
MGCAddSnippet(114, "The Profile Details window increases visibility into simulation performance. Right-clicking any function in the Ranked or Call Tree windows opens a popup menu that includes a Function Usage selection. When you select Function Usage, the Profile Details window opens and displays all instances that use the selected function. ");
MGCAddSnippet(115, "As a last step, you will filter out lines that take less than 3% of the simulation time using the Profiler toolbar.");
MGCAddSnippet(116, "Questa SIM allows you to create different profile reports based on the profiler data.");
MGCAddSnippet(117, "This concludes this lesson. Before continuing we need to end the current simulation.");
MGCAddSnippet(118, "Questa SIM Code Coverage gives you graphical and report file feedback on which executable statements, branches, conditions, and expressions in your source code have been executed. It also measures bits of logic that have been toggled during execution. ");
MGCAddSnippet(119, "The sample design for this lesson consists of a finite state machine which controls a behavioral memory. The test bench test_sm provides stimulus. ");
MGCAddSnippet(120, "Enabling Code Coverage is a simple process: You compile the design files and identify which coverage statistics you want to collect. Then you load the design and tell Questa SIM to produce those statistics.");
MGCAddSnippet(121, "After designating the type of coverage statistics we want to collect, we are ready to load and run the design.");
MGCAddSnippet(122, "Let s take a look at the coverage data displayed in different coverage windows.");
MGCAddSnippet(123, "The Source window contains coverage statistics of its own.");
MGCAddSnippet(124, "Toggle coverage counts each time a logic node transitions from one state to another. Earlier in the lesson you enabled six-state toggle coverage by using the ‑cover x argument with vopt, vlog, or vcom. ");
MGCAddSnippet(125, "Questa SIM allows you to exclude lines and files from code coverage statistics. You can set exclusions with GUI menu selections, with a text file called an  exclusion filter file , with  pragmas  in your source code, or with the coverage exclude command. Pragmas are statements that instruct Questa SIM to ignore coverage statistics for the bracketed code. ");
MGCAddSnippet(126, "Questa SIM allows you to exclude individual logic transitions from toggle coverage statistics. ");
MGCAddSnippet(127, "You can create textual or HTML reports on coverage statistics using menu selections in the GUI or by entering commands in the Transcript window. You can also create textual reports of coverage exclusions using menu selections.");
MGCAddSnippet(128, "This concludes this lesson. Before continuing we need to end the current simulation.");
MGCAddSnippet(129, "Using assertions in your HDL code increases visibility into your design and improves verification productivity. Questa SIM supports Property Specification Language (PSL) assertions for use in dynamic simulation verification. These assertions are simple statements of design intent that declare design or interface assumptions. ");
MGCAddSnippet(130, "The sample design for this lesson uses a DRAM behavioral model and a self-checking test bench. The DRAM controller interfaces between the system processor and the DRAM and must be periodically refreshed in order to provide read, write, and refresh memory operations. Refresh operations have priority over other operations, but a refresh will not preempt an in-process operation.");
MGCAddSnippet(131, "In this exercise you will use a .do file to run the design without PSL Assertions. ");
MGCAddSnippet(132, "To see how assertions can speed debugging, reload the design with assertion failure tracking enabled.");
MGCAddSnippet(133, "Now we can debug the assertion failure.");
MGCAddSnippet(134, "This concludes this lesson. ");
MGCAddSnippet(135, "This lesson provides a step-by-step introduction to functional hardware verification using SystemVerilog assertion and functional coverage capabilities.");
MGCAddSnippet(136, "This lesson uses an interleaver design with SystemVerilog assert and cover directives and SystemVerilog covergroups to gain a basic understanding of how functional verification information is gathered and displayed in Questa SIM.");
MGCAddSnippet(137, "An interleaver scrambles the byte order of incoming data in order to aid error detection and correction schemes such as Reed Solomon/Viterbi. In the design used for this lesson, the incoming data consists of a sync byte (0xb8, 0x47) followed by 203 bytes of packet data. The 203 bytes consist of 187 bytes of data to which a Reed Solomon encoder has previously appended 16 bytes of data.");
MGCAddSnippet(138, "In order to demonstrate the advantage of using assertions for debugging your design, we will start by simulating the interleaver without assertions.");
MGCAddSnippet(139, "Now we will run the simulation with assertions to demonstrate how assertions are used to speed debugging.");
MGCAddSnippet(140, "Run the simulation and debug the assertion failure.");
MGCAddSnippet(141, "The functional coverage capabilities of SystemVerilog allow you to verify your designs on a functional level.");
MGCAddSnippet(142, "You can create functional coverage reports using dialog boxes accessible through the GUI or via commands entered at the command line prompt.");
MGCAddSnippet(143, "This concludes this lesson.");
MGCAddSnippet(144, "This lesson is designed to walk you through the basics of using the SystemVerilog Direct Programming Interface (DPI) with Questa SIM. We will start with a small design that shows how simulation control flows back and forth across the boundary between Verilog simulation and code written in a foreign language. We will use code written in C, which is the foreign language most commonly used to interface with Verilog simulations.");
MGCAddSnippet(145, "The Questa SIM installation comes with the design files you need to complete this lesson.");
MGCAddSnippet(146, "Before getting started, take a look at the main design source files in order to get acquainted with the simulation flow and some of the basic requirements for DPI.");
MGCAddSnippet(147, "A Makefile has been included with this lesson to help UNIX and Linux users compile and simulate the design, or you can run  make all  to kick off the whole thing all at once. There is also a clean target to help you clean up the directory should you want to start over and run again. ");
MGCAddSnippet(148, "A windows.bat file has been included for Windows users. ");
MGCAddSnippet(149, "To start this lesson you must set your environment variable, then compile and load the design. In this case, compile and load is performed in a single step");
MGCAddSnippet(150, "Now we can run the simulation to see what happens to the  light  object in the Objects window.");
MGCAddSnippet(151, "This concludes this lesson on the basics of how DPI works in Questa SIM. You should feel comfortable with these elements before moving on to the next tutorial. This design only accomplishes some simple function calls to change the values of the signal light in order to stress how easy it is to step back and forth between Verilog and a foreign language like C. However, we have not done anything terribly interesting in regard to passing data from one language to the other. Is this possible? Most definitely. In fact, the next lesson will address this subject.");
MGCAddSnippet(152, "This lesson is designed to build on your understanding of the Direct Programming Interface (DPI) for SystemVerilog. In the previous lesson, you were shown the basic elements of the interface and how to make simple function calls to/from Verilog and C. However, no data was passed across the boundary, which is a very important topic to understand. This lesson will focus on that aspect of the interface.");
MGCAddSnippet(153, "Whenever we want to send the value of an object from Verilog to C, or vice versa, that value will have a dual personality. It may have been initialized as a bit or a reg over in the Verilog world, for example, and then passed over to C via an imported function call. The C world, however, does not have regs, bits, logic vectors, and so on. How is this going to work?");
MGCAddSnippet(154, "The design files for this lesson are located in the following directory.");
MGCAddSnippet(155, "Before getting started, let us look at the foreign.c file which contains the definitions for the two C functions we will be using to read our data values coming over from the Verilog world and print messages to let us know what is going on. ");
MGCAddSnippet(156, "A Makefile has been included with this lesson to help UNIX and LinuxLinux is a registered trademark of Linus Torvalds in the U.S. and other countries.users compile and simulate the design, or you can run  make all  to kick off the whole thing all at once. There is also a clean target to help you clean up the directory should you want to start over and run again. ");
MGCAddSnippet(157, "A windows.bat file is included for Windows users. ");
MGCAddSnippet(158, "We will compile the design and load the simulator using a makefile for Unix and Linux installations, and a windows.bat file for Windows installations.");
MGCAddSnippet(159, "Once in simulation with the test.sv module loaded, you can use the Step Over command button to advance through the simulation. This will simply set values of different types of Verilog objects and send the data over to C for print out to the screen.");
MGCAddSnippet(160, "There is certainly much more involved with passing data back and forth across the boundary between C and Verilog using DPI. What about user-defined types? What about arrays? Structs? 64-bit integers?   This particular subject can get into some intricate detail, and we have already covered quite a bit in this lesson towards the goal of helping you understand the basics of passing data through the interface. Most importantly, what you have learned should give you an understanding of how to make use of the DPI header file that the compiler creates in order to make sure your C code is written properly to interface with SystemVerilog.");
MGCAddSnippet(161, "Waveform Compare computes timing differences between test signals and reference signals.");
MGCAddSnippet(162, "The sample design for this lesson consists of a finite state machine which controls a behavioral memory. The test bench test_sm provides stimulus. ");
MGCAddSnippet(163, "The reference dataset is the .wlf file that the test dataset will be compared against. It can be a saved dataset, the current simulation dataset, or any part of the current simulation dataset.");
MGCAddSnippet(164, "The test dataset is the .wlf file that will be compared against the reference dataset. Like the reference dataset, the test dataset can be a saved dataset, the current simulation dataset, or any part of the current simulation dataset.");
MGCAddSnippet(165, "Questa SIM includes a Comparison Wizard that walks you through the process. You can also configure the comparison manually with menu or command line commands.");
MGCAddSnippet(166, "Comparison data is displayed in the Structure (compare), Transcript, Objects, Wave and List windows. Compare objects are denoted by a yellow triangle. ");
MGCAddSnippet(167, "The Wave window displays comparison information in a clear graphic format.");
MGCAddSnippet(168, "You can also view the results of your waveform comparison in the List window.");
MGCAddSnippet(169, "You can save comparison data for later viewing, either in a text file or in files that can be reloaded into Questa SIM. ");
MGCAddSnippet(170, "This concludes this lesson. Before continuing we need to end the current simulation and close the gold.wlf dataset.");
MGCAddSnippet(171, "Aside from executing a couple of pre-existing DO files, the previous lessons focused on using Questa SIM in interactive mode: executing single commands, one after another, through the GUI menus or Main window command line. In situations where you have repetitive tasks to complete, you can increase your productivity with DO files. ");
MGCAddSnippet(172, "Creating a DO file is as simple as typing a set of commands in a text file. In this exercise, you will create a DO file that loads a design, adds signals to the Wave window, provides stimulus to those signals, and then advances the simulation. You can also create a DO file from a saved transcript file. ");
MGCAddSnippet(173, "We use the term  command-line mode  to refer to simulations that are run from a DOS/ UNIX prompt without invoking the GUI. Several Questa SIM commands (for example, vsim, vlib, vlog, and so on) are actually stand-alone executables that can be invoked at the system command prompt. Additionally, you can create a DO file that contains other Questa SIM commands and specify that file when you invoke the simulator.");
MGCAddSnippet(174, "The DO files used in previous exercises contained only Questa SIM commands. However, DO files are really just Tcl scripts. This means you can include a whole variety of Tcl constructs such as procedures, conditional operators, math and trig functions, regular expressions, and so forth.");
MGCAddSnippet(175, "This concludes this lesson.");
MGCAddSnippet(176, "This tutorial for Questa Power Aware Simulation (Questa PASim) is designed to teach you about: ");
MGCAddSnippet(177, "There are a few general concepts you should understand before starting on the interactive portion of the tutorial.");
MGCAddSnippet(178, "This tutorial utilizes the UPF 2.0 Successive Refinement Methodology for power intent specification. ");
MGCAddSnippet(179, "The UPF power intent process step occurs by executing the vopt command and loading both the top-level design and the UPF file, as specified by the -pa_upf option to the vopt command. ");
MGCAddSnippet(180, "You can customize many parts of your Questa PASim flow through the use of command line arguments to the vopt command. ");
MGCAddSnippet(181, "The design for this example is a clock-driven memory interleaver with an associated test bench.");
MGCAddSnippet(182, "There are two tasks you must perform before beginning the various simulation runs for this tutorial.");
MGCAddSnippet(183, "Before you simulate the design for this example, you should make a copy of it in a working location.");
MGCAddSnippet(184, "The compilation step processes the HDL design and generates code for simulation. This step is the same for both power aware and non-power aware simulation.");
MGCAddSnippet(185, "The first simulation involves the constraint (mem_ctrl_const.upf) and configuration (mem_ctrl_config.upf) UPF files. ");
MGCAddSnippet(186, "You can open the files (using the edit command in the Transcript window) to view the limited power intent information they contain. A third UPF file will be used to connect the power control registers of the test bench to the UPF-created power control logic ports of the design.");
MGCAddSnippet(187, "This first power aware simulation using the Questa SIM GUI will acquaint you with several of its power aware and UPF debug features. ");
MGCAddSnippet(188, "There are several important simulation and UPF debug features available in the Questa SIM GUI.");
MGCAddSnippet(189, "Recall that the second time the PD_mem_ctrl domain is power cycled, the test bench does not enable isolation for the PD_mem_ctrl domain outputs. In the wave window, starting at about 167us, you will notice that the address, write enable, and chip enable inputs to the SRAM models (SRAM #1 signal group) are all unknown as a result of the unisolated outputs from the PD_mem_ctrl domain, which have propagated to the SRAMs. This propagation of unknown values is a problem. ");
MGCAddSnippet(190, "The second simulation run involves processing the rtl_top.upf file in addition to the two UPF files used in the first power aware simulation.");
MGCAddSnippet(191, "The new UPF file updates the power intent specification with the following information:");
MGCAddSnippet(192, "You can now run the second power aware simulation with the same .do file used to run the first power aware Simulation. ");
MGCAddSnippet(193, "The third simulation run involves processing the rtl_top_imp.upf file in addition to the three UPF files used in the second power aware simulation.");
MGCAddSnippet(194, "The new UPF file updates the power intent specification with the following implementation power intent information:");
MGCAddSnippet(195, "In this simulation run you will be introduced to the Questa PASim supply network visualization feature and the power coverage test plan tracking. ");
MGCAddSnippet(196, "The role that Liberty files play in power aware simulations varies widely. As mentioned previously, one important use of Liberty files is to identify the existence of power management cells which are already present in a design. For designs containing pre-existing power management cells, it is typically required that they be detected in order to prevent the insertion of duplicate power management cells.");
MGCAddSnippet(197, "You can specify a list of Liberty files as an argument to the vopt command with the ‑pa_libertyfiles= option to be processed at the same time as any UPF files. ");

